[{"location":"#AristaEAPI.jl-Documentation","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.jl Documentation","text":"","category":"section"},{"location":"","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.jl Documentation","text":"","category":"page"},{"location":"#High-level-functions","page":"AristaEAPI.jl Documentation","title":"High level functions","text":"","category":"section"},{"location":"","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.jl Documentation","text":"These functions return the results of commonly used commands for getting switch status and statistics.  All of them return a Vector{NamedTuple}.  The keys of the NamedTuples closely follow the field names used in the textual output of the switch CLI.","category":"page"},{"location":"#AristaEAPI.interfaces_counters_rates","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.interfaces_counters_rates","text":"interfaces_counters_rates(host[, interfaces]; username, password, protocol)\n\nReturn NamedTuple of interface counter rates from host.\n\ninterfaces may be given as a comma separated string of interfaces or a Vector of interfaces to be queried.  If not given, all interfaces will be queried.\n\nusername and password default to admin.  protocol defaults to https, but may be given as http instead.\n\n\n\n\n\n","category":"function"},{"location":"#AristaEAPI.lldp_neighbors","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.lldp_neighbors","text":"lldp_neighbors(host[, interfaces]; username, password, protocol)\n\nReturn NamedTuple of LLDP neighbors of host.\n\ninterfaces may be given as a comma separated string of interfaces or a Vector of interfaces to be queried.  If not given, all interfaces will be queried.\n\nusername and password default to admin.  protocol defaults to https, but may be given as http instead.\n\n\n\n\n\n","category":"function"},{"location":"#AristaEAPI.mac_address_table","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.mac_address_table","text":"mac_address_table(host[, interfaces]; address, username, password, protocol)\n\nReturn NamedTuple of the unitcase mac address table of host.\n\ninterfaces may be given as a comma separated string of interfaces or a Vector of interfaces to be queried.  If not given, all interfaces will be queried. Optionally, a MAC address may be passed as address to query for a specific MAC address.\n\nusername and password default to admin.  protocol defaults to https, but may be given as http instead.\n\n\n\n\n\n","category":"function"},{"location":"#Low-level-function","page":"AristaEAPI.jl Documentation","title":"Low level function","text":"","category":"section"},{"location":"","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.jl Documentation","text":"Thes functions are used by the high level functions to run commands on the switch using the Arista EAPI.  They can be used to run any commands that your switch supports over EAPI.  This function returns a JSON3.Object that can be used as a Dict{Symbol, Any}.  This object represents the JSON RPC response from the switch.  The results of interest can be obtained from this object via the :result key.","category":"page"},{"location":"#AristaEAPI.run_command","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.run_command","text":"run_command(host, cmd::AbstractString; username, password, protocol)\n\nRun Arista command cmd on host using Arista EAPI.\n\nusername and password default to admin.  protocol defaults to https, but may be given as http instead.\n\n\n\n\n\n","category":"function"},{"location":"#AristaEAPI.run_commands","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.run_commands","text":"run_commands(host, cmds::AbstractVector; username, password, protocol)\n\nRun Arista commands cmds on host using Arista EAPI.\n\nusername and password default to admin.  protocol defaults to https, but may be given as http instead.\n\n\n\n\n\n","category":"function"},{"location":"#Example","page":"AristaEAPI.jl Documentation","title":"Example","text":"","category":"section"},{"location":"","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.jl Documentation","text":"julia> reply = run_command(\"arista1g\", \"show version\")\nJSON3.Object{Base.CodeUnits{UInt8, String}, Vector{UInt64}} with 3 entries:\n  :jsonrpc => \"2.0\"\n  :result  => Object[{â€¦\n  :id      => \"AristaEAPI.jl-yA6T96mC\"\n\njulia> reply[:result]\n1-element JSON3.Array{JSON3.Object, Base.CodeUnits{UInt8, String}, SubArray{UInt64, 1, Vector{UInt64}, Tuple{UnitRange{Int64}}, true}}:\n {\n          \"modelName\": \"DCS-7048T-A-R\",\n    \"internalVersion\": \"4.15.7M-3284043.4157M\",\n   \"systemMacAddress\": \"00:1c:73:a0:b8:df\",\n       \"serialNumber\": \"JPE14471431\",\n           \"memTotal\": 3978148,\n    \"bootupTimestamp\": 1.75581673972e9,\n            \"memFree\": 770812,\n            \"version\": \"4.15.7M\",\n       \"architecture\": \"i386\",\n      \"isIntlVersion\": false,\n    \"internalBuildId\": \"b0b0dff8-c9ca-40cc-a625-7fd3c8c76ebd\",\n   \"hardwareRevision\": \"01.07\"\n}","category":"page"},{"location":"#Index","page":"AristaEAPI.jl Documentation","title":"Index","text":"","category":"section"},{"location":"","page":"AristaEAPI.jl Documentation","title":"AristaEAPI.jl Documentation","text":"","category":"page"}]
